import React, { useState, useEffect } from 'react';
import { View, Text, StyleSheet, TouchableOpacity, Animated, TouchableWithoutFeedback, ScrollView, BackHandler, Image } from 'react-native';
import Background from '../components/Background';
import Header from '../components/Header';
import Icon from 'react-native-vector-icons/FontAwesome';

import WelcomeImage from '../assets/logo.png';

export default function Dashboard({ navigation }) {
  const [scaleValue] = useState(new Animated.Value(1));
  const [isEditing, setIsEditing] = useState(false);

  const handlePlusButtonPress = () => {
    setIsEditing(!isEditing);
  };

  const toggleProfileIcon = () => {
    navigation.navigate('ProfileIcon');
  };

  const toggleCartIcon = () => {
    navigation.navigate('CartIcon');
  };

  const handlePress = (menu) => {
    Animated.sequence([
      Animated.timing(scaleValue, { toValue: 0.9, duration: 100, useNativeDriver: true }),
      Animated.timing(scaleValue, { toValue: 1, duration: 100, useNativeDriver: true }),
    ]).start(() => {
      if (menu === 'McDonalds') {
        navigation.navigate(menu + 'Menu');
      } else if (menu === 'Subway') {
        navigation.navigate(menu);
      } else if (menu === 'KFC') {
        navigation.navigate(menu);
      }
    });
  };

  const cartItems = [];

  useEffect(() => {
    const backAction = () => {
      if (navigation.isFocused()) {
        return true;
      }
      return false;
    };

    const backHandler = BackHandler.addEventListener('hardwareBackPress', backAction);

    return () => backHandler.remove();
  }, [navigation]);

  return (
    <ScrollView contentContainerStyle={styles.scrollContainer}>
      <Background>
        <Header style={styles.navigationHeader}>
          <TouchableOpacity style={styles.profileButton} onPress={toggleProfileIcon}>
            <View style={styles.iconCircle}>
              <Icon name="user" size={30} color="#FFF" />
            </View>
          </TouchableOpacity>
          <TouchableOpacity style={styles.cartButton} onPress={toggleCartIcon}>
            <View style={styles.iconCircle}>
              <Icon name="shopping-cart" size={30} color="#FFF" />
              {cartItems.length > 0 && (
                <Text style={styles.cartItemCount}>{cartItems.length}</Text>
              )}
            </View>
          </TouchableOpacity>
        </Header>

        <View style={styles.headerContainer}>
          <Image source={WelcomeImage} style={styles.welcomeImage} />
          <Text style={styles.welcomeText}>Welcome to APPLEGO Express</Text>
        </View>

        {/* Rest of your content here */}
      </Background>
    </ScrollView>
  );
}

const styles = StyleSheet.create({
  scrollContainer: {
    flexGrow: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  navigationHeader: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: 60,
    paddingHorizontal: 16,
    backgroundColor: '#C70039',
  },
  headerContainer: {
    alignItems: 'center',
    marginBottom: 20,
  },
  welcomeImage: {
    width: 90, // Adjust the width to fit your image
    height: 90, // Adjust the height to fit your image
    marginBottom: 20,
  },
  welcomeText: {
    fontSize: 27,
    fontWeight: 'bold',
    textAlign: 'center',
    marginBottom: 20,
    color: '#333',
  },
  brandButton: {
    backgroundColor: '#ffffff',
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'space-between',
    padding: 10,
    borderRadius: 8,
    marginBottom: 20,
    height: 180,
    width: 300,
    borderWidth: 0.5,
    shadowOffset: { width: 4, height: 5 },
    shadowOpacity: 0.5,
    shadowRadius: 2,
    elevation: 4,
  },
  brandButtonText: {
    fontSize: 24,
    fontWeight: 'bold',
    color: '#C70039',
  },
  salesQuote: {
    fontSize: 18,
    fontStyle: 'italic',
    textAlign: 'center',
  },
  additionalInfo: {
    fontSize: 16,
    textAlign: 'center',
    marginTop: 10,
    color: '#333',
  },
  cartButton: {
    position: 'absolute',
    top: 50,
    right: 20,
    backgroundColor: 'transparent',
  },
  cartIcon: {
    fontSize: 24,
  },
  cartItemCount: {
    position: 'absolute',
    top: 0,
    right: 0,
    backgroundColor: 'red',
    color: 'white',
    borderRadius: 12,
    paddingHorizontal: 6,
    paddingVertical: 3,
    fontSize: 14,
  },
  profileButton: {
    position: 'absolute',
    top: 50,
    left: 20,
  },
  iconCircle: {
    width: 60,
    height: 60,
    borderRadius: 30,
    backgroundColor: '#C70039',
    justifyContent: 'center',
    alignItems: 'center',
  },
});
